import React from 'react';
import { motion } from 'framer-motion';
import { Github, ExternalLink, Archive, Shield } from 'lucide-react';

const Footer = () => {
  const links = [
    { name: 'GDPR Info', icon: Shield, url: '#' },
    { name: 'Wayback Machine', icon: Archive, url: 'https://web.archive.org' },
    { name: 'Privacy Tools', icon: ExternalLink, url: '#' },
    { name: 'GitHub', icon: Github, url: '#' }
  ];

  return (
    <footer className="bg-black py-12 px-4 border-t border-cyber-blue/30">
      <div className="max-w-7xl mx-auto">
        <div className="grid md:grid-cols-3 gap-8 mb-8">
          <div>
            <h3 className="text-2xl font-bold glow-text mb-4">The Internet Never Forgets</h3>
            <p className="text-gray-400">A research project exploring digital permanence and online privacy.</p>
          </div>

          <div>
            <h4 className="text-lg font-bold mb-4 text-cyber-blue">Resources</h4>
            <div className="space-y-2">
              {links.map((link, index) => (
                <motion.a
                  key={index}
                  href={link.url}
                  whileHover={{ x: 5, color: '#00f5ff' }}
                  className="flex items-center gap-2 text-gray-400 hover:text-cyber-blue"
                >
                  <link.icon size={16} />
                  {link.name}
                </motion.a>
              ))}
            </div>
          </div>

          <div>
            <h4 className="text-lg font-bold mb-4 text-cyber-blue">Contact</h4>
            <p className="text-gray-400">University Research Project</p>
            <p className="text-gray-400">Digital Privacy & Security</p>
          </div>
        </div>

        <div className="border-t border-gray-800 pt-8 text-center">
          <p className="text-gray-500">Â© 2024 The Internet Never Forgets. Educational purposes only.</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
